import React, { useState, useRef } from "react";

const Guess = (props) => {
    const [userGuess, setUserGuess] = useState("");
  return (
    <div>
      <form>
        <label>
          Enter your guess:
          <input
            type="text"
            value={userGuess}
            onChange={(e) => setUserGuess(e.target.value)}
          />
        </label>
      </form>
      <img src={props.value} />
    </div>
  );
};

export default Guess;
